import React from "react";
import classes from "./cart.scss"
import CartItemHeader from "./CartItemHeader";

const Cart = () => {


    return(
        <>
        <div className={classes.block_cart}>
            <div className={classes.block_cart_left}>
                <CartItemHeader 
                    name="Item"
                />
            </div>
            <div className={classes.block_cart_right}>
                <p className={classes.block_cart_quantity}>Quantity</p>
                <p className={classes.block_cart_price}>Price</p>
                <p className={classes.block_cart_total_price}>Total Price</p>
            </div>
        </div>
        </>
    )
}

export default Cart;
